-- ----------------------------
-- Function structure for f_pinyin
-- ----------------------------
DROP FUNCTION IF EXISTS `f_pinyin`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` FUNCTION `f_pinyin`(p_name varchar(3000)) RETURNS varchar(3000) CHARSET utf8
BEGIN
	DECLARE tmp_str VARCHAR(100) CHARSET gbk DEFAULT '' ;
	DECLARE tmp_char VARCHAR(100) CHARSET gbk DEFAULT '' ; 
	DECLARE V_LEN INT;
	DECLARE V_I INT;
	DECLARE V_PY VARCHAR(3000);
	SET V_LEN=CHAR_LENGTH(p_name);
	SET V_I=1;
	SET V_PY='';

	WHILE V_I<=V_LEN DO 
	  SET tmp_str = substring(p_name,V_I,1);
	  IF ASCII(tmp_str)<127 
	  THEN
	    SET tmp_char=UPPER(tmp_str);
	  ELSE
	    SELECT letter INTO tmp_char FROM dic_pinyin WHERE chr<=tmp_str ORDER BY chr DESC LIMIT 1;
	  END IF ;
	  SET V_I=V_I+1;
	  SET V_PY=CONCAT(V_PY,tmp_char);
	END WHILE;

	RETURN V_PY;
END
;;
delimiter ;

