             when ORD(CONVERT(D_word USING ucs2)) between 65313 and 65313+25 then char(65+ORD(CONVERT(D_word USING ucs2))-65313)
						 -- ΑΒΓ
             WHEN ORD(CONVERT(D_word USING ucs2)) between 913 and 913+2 then char(65+ORD(CONVERT(D_word USING ucs2))-913) 
						 -- 不知何故,必须加上这句没用的语句,创建函数才不会报错
						 WHEN 1=2 THEN ''
						 else ''
             end));
    END IF;
    set p_input=right(p_input,CHARACTER_LENGTH(p_input)-1);
	END WHILE;
	
  RETURN Retu;
end
;;
delimiter ;

-- ----------------------------
-- Procedure structure for p_completion_job
-- ----------------------------
DROP PROCEDURE IF EXISTS `p_completion_job`;
delimiter ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `p_completion_job`(
	in in_operator_name VARCHAR(30)
	,out out_if_succ int
)
BEGIN
	DECLARE EXIT HANDLER FOR SQLEXCEPTION
	BEGIN
	  -- 返回-1表示执行失败
	  SET out_if_succ = -1;
		ROLLBACK;
	END;
	
	SET out_if_succ = 1;
	START TRANSACTION;
	
  delete from treat_master where audit_doctor!='' and operator=in_operator_name;

	COMMIT;
END
;;
delimiter ;

