-- ----------------------------
-- Triggers structure for table treat_master
-- ----------------------------
DROP TRIGGER IF EXISTS `tg_treat_master_bf_insert_patient_info`;
delimiter ;;
CREATE TRIGGER `tg_treat_master_bf_insert_patient_info` BEFORE INSERT ON `treat_master` FOR EACH ROW label:BEGIN
	if NEW.patient_unid is NULL THEN LEAVE label; END IF;
	
	select patient_name,patient_sex,patient_birthday,certificate_type,certificate_num,clinic_card_num,health_care_num,address,work_company,work_address,if_marry,native_place,telephone
	into @patient_name,@patient_sex,@patient_birthday,@certificate_type,@certificate_num,@clinic_card_num,@health_care_num,@address,@work_company,@work_address,@if_marry,@native_place,@telephone 
	from patient_info where unid=NEW.patient_unid;
	
	SET NEW.patient_name = @patient_name;
	SET NEW.patient_sex = @patient_sex;
	SET NEW.patient_birthday = @patient_birthday;
	SET NEW.certificate_type = @certificate_type;
	SET NEW.certificate_num = @certificate_num;
	SET NEW.clinic_card_num = @clinic_card_num;
	SET NEW.health_care_num = @health_care_num;
	SET NEW.address = @address;
	SET NEW.work_company = @work_company;
	SET NEW.work_address = @work_address;
	SET NEW.if_marry = @if_marry;
	SET NEW.native_place = @native_place;
	SET NEW.telephone = @telephone;
	
	SET NEW.patient_pinyin = f_pinyin(@patient_name);
	SET NEW.patient_wbm = f_wbm(@patient_name);
	SET NEW.patient_age = TIMESTAMPDIFF(YEAR,@patient_birthday,CURDATE());
END
;;
delimiter ;

